BENCHMARK_CAPTURE(TestName, big_prime_8, "")->Iterations(100)->Unit(benchmark::kMillisecond); \
BENCHMARK_CAPTURE(TestName, big_prime_9, "")->Iterations(100)->Unit(benchmark::kMillisecond); \
BENCHMARK_CAPTURE(TestName, big_prime_10, "")->Iterations(100)->Unit(benchmark::kMillisecond);

#define BenchmarkOnTenLargestPrimes(TestName) \
BENCHMARK_CAPTURE(TestName, big_prime_1, "531137992816767098689588206552468627329593117727031923199444138200403559860852242739162502265229285668889329486246501015346579337652707239409519978766587351943831270835393219031728127")->Iterations(100)->Unit(benchmark::kMillisecond); \
BENCHMARK_CAPTURE(TestName, big_prime_2, "")->Iterations(100)->Unit(benchmark::kMillisecond); \
BENCHMARK_CAPTURE(TestName, big_prime_3, "")->Iterations(100)->Unit(benchmark::kMillisecond); \
BENCHMARK_CAPTURE(TestName, big_prime_4, "")->Iterations(100)->Unit(benchmark::kMillisecond); \
